import { Component } from '@angular/core';
import { faListCheck,faUser,faHand,faLocationDot, faUsers } from '@fortawesome/free-solid-svg-icons';
@Component({
  selector: 'app-adminsidebar',
  templateUrl: './adminsidebar.component.html',
  styleUrls: ['./adminsidebar.component.css']
})
export class AdminsidebarComponent {

  manyUsers=faUsers;
  faUser= faUser;
  tasks=faListCheck;
  help=faHand;
  location=faLocationDot;

}
<div>
    <div class="company-logo">
      <img src="../../assets/image-accordion.png"  alt="company logo is missing" width="200px" height="100px">
    </div>
    <mat-divider></mat-divider>
    <div class="nav-items">
    <div class="nav-item">
        <fa-icon [icon]="manyUsers"></fa-icon>
        <a routerLink="/admindashboard/allusers">All Users</a></div>
    <div class="nav-item">
        <fa-icon [icon]="faUser"></fa-icon>
        <a routerLink="../admindashboard/create-project">New Project</a></div>
    <div class="nav-item">
        <fa-icon [icon]="faUser"></fa-icon>
        <a routerLink="/admindashboard/newmanager">New Employee</a></div>
    <div class="nav-item">
        <fa-icon [icon]="faUser"></fa-icon>
        <a routerLink="../admindashboard/update-status">Update Status</a></div>
    <div class="nav-item">
        <fa-icon [icon]="faUser"></fa-icon>
        <a routerLink="../admindashboard/delete-user">Update Status</a></div>
  </div>
  </div>
